JArray customFilters = new JArray();

// Iterate over the filters datatable and add to customFilters
foreach (DataRow row in filters.Rows)
{
	JObject filter = new JObject();
	filter["customFilter"] = (bool)row["Ekskluder"] ? "exclude" : "";
	filter["fieldName"] = row["Feltnavn"].ToString();

	JArray values = new JArray();
	DataTable valuesTable = (DataTable)row["Værdier"];
	foreach (DataRow valueRow in valuesTable.Rows)
	{
		values.Add(valueRow["Værdi"] == DBNull.Value ? null : valueRow["Værdi"].ToString());
	}

	filter["values"] = values;
	customFilters.Add(filter);
}

// Add customFilters to the json
json["filters"] = customFilters;


result = json.ToString();

