JArray newCaseworkers = JArray.Parse(caseworkerJson);

foreach (var item in newCaseworkers)
{
    string actorId = item["caseworkerId"].ToString();
    string responsibilityName = item["responsibilityName"].ToString();

    // Handle private contact persons separately
    if (responsibilityName == "Bisidder" || responsibilityName == "Partsrepræsentant")
    {
        string privateContactId = item["id"].ToString(); // Use "id" instead of "caseworkerId"
        string privateResponsibilityCode = responsibilityName == "Bisidder"
            ? "0acce8a4-d610-4a97-9c57-5abd4d14ae80"
            : "fbe758a1-03aa-49c1-9ad5-27400b379cb7";

        var privateContact = new JObject
        {
            ["actorId"] = privateContactId, // Corrected to use "id"
            ["responsibilityCodes"] = new JArray(privateResponsibilityCode) // Fixed variable name
        };

        privateContacts.Add(privateContact);
        continue; // Skip the rest of the loop since it's not a caseworker
    }

    // Parse role as a floating-point value (float or double)
    float roleValue = item["role"].Value<float>();
    int role = roleValue == 1.0f ? 1 : 0;

    var newCaseworker = new JObject
    {
        ["actorId"] = actorId,
        ["role"] = role
    };

    // Map responsibilityName to responsibilityCode
    string responsibilityCode;
    switch (responsibilityName)
    {
        case "Øvrig ansvarlig":
            responsibilityCode = "OVRIG_ANSVARLIG";
            break;
        case "Beskæftigelsessagsbehandler":
            responsibilityCode = "BESKAFTIGELSESSAGSBEHANDLER";
            break;
        case "Anden aktør":
            responsibilityCode = "ANDEN_AKTOR";
            break;
        case "Sanktionsteam":
            responsibilityCode = "74be96ca-5fd3-44c2-a951-cba7f3dc9c97";
            break;
        case "Fastholdelseskonsulent":
            responsibilityCode = "CASEWORKER_RESPONSIBILITY_FASTHOLDELSESKONSULENT";
            break;
        case "Jobkonsulent":
            responsibilityCode = "CASEWORKER_RESPONSIBILITY_JOBKONSULENT";
            break;
        case "Kommunal udslusningskoordinator":
            responsibilityCode = "KOMMUNAL_UDSLUSNINGSKOORDINATOR";
            break;
        case "Sekundær ansvarlig":
            responsibilityCode = "SEKUNDER_ANSVARLIG";
            break;
        case "Leder":
            responsibilityCode = "LEDER";
            break;
        case "Mentor":
            responsibilityCode = "MENTOR";
            break;
        case "Personlig jobformidler":
            responsibilityCode = "PERSONLIG_JOBFORMIDLER";
            break;
        case "Koordinerende sagsbehandler":
            responsibilityCode = "KOORDINERENDE_SAGSBEHANDLER";
            break;
        case "Virksomhedskonsulent":
            responsibilityCode = "VIRKSOMHEDSKONSULENT";
            break;
        case "Støtte-kontaktperson":
            responsibilityCode = "STØTTE-KONTAKTPERSON";
            break;
        case "Ydelsesmedarbejder":
            responsibilityCode = "YDELSESMEDARBEJDER";
            break;
        case "Tilbudsansvarlig":
            responsibilityCode = "TILBUDSANSVARLIG";
            break;
        case "Uddannelsesvejleder":
            responsibilityCode = "UDDANNELSESVEJLEDER";
            break;
        default:
            responsibilityCode = "OVRIG_ANSVARLIG"; // Default case if name doesn't match
            break;
    }

    // Safely parse "showInJobnet" without exceptions
    bool showInJobnet = item["showInJobnet"]?.Type == JTokenType.Boolean && item["showInJobnet"].Value<bool>();

    if (role == 0) // When role is 0
    {
        var responsibilities = new JArray
        {
            new JObject
            {
                ["responsibilityCode"] = responsibilityCode,
                ["showInJobnet"] = showInJobnet ? JToken.FromObject(true) : null // Only add if true
            }
        };

        newCaseworker["responsibilities"] = responsibilities;
    }
    else // When role is 1
    {
        newCaseworker["responsibilities"] = new JArray(); // Empty responsibilities
    }

    caseworkers.Add(newCaseworker);
}

