count = 0;

if (jsonToken is JArray){
	taxons = (JArray)jsonToken;

	 if (string.IsNullOrEmpty(TaxonomiName))
    {
         foundTax = taxons
            .SelectMany(root => root["items"])
            .ToList();  // Get all items
    }else{
		foundTax = taxons
            .SelectMany(root => root["items"])
            .Where(item => string.Equals(item["name"]?.ToString(), TaxonomiName, StringComparison.OrdinalIgnoreCase)).ToList();
	}

	 foreach (var item in foundTax)
	 {
		 var parentCode = taxons.FirstOrDefault(root => root["items"] != null && root["items"].Any(i => string.Equals(i["code"]?.ToString(), item["code"]?.ToString(), StringComparison.OrdinalIgnoreCase)))?["code"];

          if (parentCode != null){
               item["parentCode"] = parentCode;
		  }
	 }
}

if (jsonToken is JObject jsonObject){
	taxons = (JArray)jsonObject["taxons"];

	 if (!string.IsNullOrEmpty(TaxonomiName))
    {
		foundTax = taxons.Where(x => string.Equals(x["name"]?.ToString(), TaxonomiName, StringComparison.OrdinalIgnoreCase)).ToList();
	}else{
		foundTax = taxons.ToList();
		}

	foreach (var item in foundTax){
		item["parentCode"] = jsonObject["code"];  // Add the parent "code" to each item
		}
}



if(foundTax != null){


	table = new DataTable();

    if (foundTax.Any())
    {
        // Add columns to DataTable based on the properties of the first item in the list
        var firstItem = foundTax.First().ToObject<JObject>();
        foreach (var property in firstItem.Properties())
        {
            table.Columns.Add(property.Name);
        }

        // Add rows to DataTable
        foreach (var item in foundTax)
        {
            var row = table.NewRow();
            var jObject = item.ToObject<JObject>();
            foreach (var property in jObject.Properties())
            {
                row[property.Name] = property.Value.ToString();
            }
            table.Rows.Add(row);
			count = count+1;
        }
    }


}

